import ChargesResume from '../../components/ChargesResume';
import Header from '../../components/Header';
import SideMenu from '../../components/SideMenu';
import './styles.css';

const Home = () => {
  return(
    <>
      <div className="sign-home">
        <SideMenu/> 
        <Header/>
        <div className="sign-cards-resumo">
          <ChargesResume/>
        </div>
      </div>
    </>     
  ); 
};

export default Home;
